import React from "react";

const AppHeader = () =>{
    return(
        <div>
            <div><h1>My Todo List</h1></div>
            <div>
                <nav className="navbar navbar-light bg-light">

                        <input className="form-control mr-sm-2" type="text" placeholder="Search">

                        </input>
                </nav>
            </div>
        </div>

    )
}

export default AppHeader;
